import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
    <>
        <p style={{
            fontSize: '28px', margin: '10px', fontFamily: "'Lato', sans-serif",
            backgroundColor: 'antiquewhite',
            padding: '20px'
        }}>Hi, it's Yash Pandey here.</p>
        <ol>
            <li>Dark Batman</li>
            <li>Yash Pandey</li>
            <li>Ak47</li>
        </ol>
    </>
    , document.getElementById('root')
);
